import React, { useContext } from 'react';
import CommentFeed from '../../components/comments/CommentFeed';
import { CommentContext } from '../../components/comments/CommentContext';

interface PrincipalProps {
  // No contexto, os comentários são acessados ​​através do contexto, então não precisamos mais disso aqui.
}

const Principal: React.FC<PrincipalProps> = () => {
  // Acesse o contexto para obter os comentários
  const { comments } = useContext(CommentContext);

  return (
    <div>
      {/* Renderize o componente CommentFeed e passe a propriedade 'comments' do contexto */}
      <CommentFeed comments={comments} />
    </div>
  );
};

export default Principal;
